import org.apache.spark.ml.feature.VectorAssembler

val glr = new GeneralizedLinearRegression().setFamily("gaussian").setLink("identity").setMaxIter(10).setRegParam(0.3)


val assembler = new VectorAssembler().setInputCols(Array("horsepower")).setOutputCol("features")

val subDF1 = dfAutoAttribs.select("city-mpg","horsepower")
val subDF2 = subDF1.withColumnRenamed("city-mpg","id");
val subDF3 = assembler.transform(subDF2)
val subDF4 = subDF3.withColumn("label",monotonicallyIncreasingId)
val subDF5 = subDF4.drop("horsepower")
subDF5.show()
//val subDF3 =  subDF2.withColumnRenamed("horsepower","features");
val model = glr.fit(subDF5)
val summary = model.summary;
val resultDF_new = model.transform(subDF5)
resultDF_new.show()
println(model.toString())
println("Coeffecients : "+ model.coefficients)
println(" Intercept : " + model.intercept)

val valuesAndPreds = labeled.map{ point => 
val prediction = model.predict(point.features)
(point.label, prediction)
}
val MSE = valuesAndPreds.map{
    case(v,p) => math.pow((v - p), 2) 

}.mean() 
println(" Training MSE = " + MSE)
println(" Model weights and intercept : "+ model.weights + " : "+ model.intercept)

